import React, { Component } from 'react';
import { Menu, Icon } from 'antd';

class Sidebar extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        const { SubMenu } = Menu;
        return (
            <Menu
                onClick={this.handleClick}
                style={{ width: 256 }}
                defaultSelectedKeys={['1']}
                defaultOpenKeys={['sub1']}
                mode="inline"
            >
                <SubMenu
                    key="sub1"
                    title={
                        <span>
                        <Icon type="mail" />
                        <span>Writing Prompts</span>
                        </span>
                    }
                >

                <Menu.ItemGroup key="g2" title="Filter">
                    <Menu.Item key="3">Liked</Menu.Item>
                    <Menu.Item key="4">Saved</Menu.Item>
                    <Menu.Item key="4">Profile</Menu.Item>
                </Menu.ItemGroup>

                <Menu.ItemGroup key="g1" title="Categories">
                    <Menu.Item key="1">Comedy</Menu.Item>
                    <Menu.Item key="2">Drama</Menu.Item>
                    <Menu.Item key="3">Romance</Menu.Item>
                    <Menu.Item key="4">Sci-Fi</Menu.Item>
                    <Menu.Item key="5">Other</Menu.Item>
                </Menu.ItemGroup>

                </SubMenu>
            </Menu>        
        );
    }
}

export default Sidebar;
